import React from "react";
import  "./artist.css"
import Gallery from '../../assets/img/gallery.png';


const Artist = () => {
    return (
        <div className="artist" id="the-artist">
            <div className="section">
                <div className="left">
                <img src={Gallery} alt="The Void logo" className="table"></img>
                </div>
                <div className="right">

                </div>
            </div>
        </div>
    )
}

export default Artist
